import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useGameState } from '../contexts/GameStateContext';
import { formatCurrency } from '../utils/formatters';

const January = () => {
  const navigate = useNavigate();
  const { gameState, updateGameState } = useGameState();
  const [showW4Form, setShowW4Form] = useState(false);
  const [showNameInput, setShowNameInput] = useState(true);
  const [showAllowances, setShowAllowances] = useState(false);
  const [showResults, setShowResults] = useState(false);

  useEffect(() => {
    // Initialize January
    if (gameState.username) {
      setShowNameInput(false);
      setShowAllowances(true);
    }
  }, [gameState.username]);

  const handleNameSubmit = (e) => {
    e.preventDefault();
    const name = e.target.playerName.value.trim();
    if (name) {
      updateGameState({
        ...gameState,
        username: name
      });
      setShowNameInput(false);
      setShowAllowances(true);
    } else {
      alert('Please enter your name to continue.');
    }
  };

  const handleJobSelection = (salary) => {
    updateGameState({
      ...gameState,
      grossIncome: salary
    });
    setShowW4Form(true);
  };

  const calculateNetPay = (e) => {
    e.preventDefault();
    const allowance1 = parseInt(e.target.allowance1.value) || 0;
    const allowance2 = parseInt(e.target.allowance2.value) || 0;
    const allowance3 = parseInt(e.target.allowance3.value) || 0;
    let totalAllowances = Math.min(allowance1 + allowance2 + allowance3, 4);

    const gross = gameState.grossIncome;
    const ssDeduction = gross * 0.038;
    const taxRates = [0.21, 0.15, 0.12, 0.10, 0.08];
    const incomeTax = gross * taxRates[totalAllowances];
    const net = gross - ssDeduction - incomeTax;

    updateGameState({
      ...gameState,
      allowances: totalAllowances,
      netIncome: net,
      currentBalance: net,
      incomeTax: incomeTax
    });

    setShowW4Form(false);
    setShowResults(true);
  };

  return (
    <div className="january-container">
      <div className="left-panel">
        <h2>Financial Summary</h2>
        <div className="summary-item">
          <span>Gross Salary:</span>
          <span>{formatCurrency(gameState.grossIncome)}</span>
        </div>
        <div className="summary-item">
          <span>Income Tax:</span>
          <span>{formatCurrency(gameState.incomeTax || 0)}</span>
        </div>
        <div className="summary-item">
          <span>Net Income:</span>
          <span>{formatCurrency(gameState.netIncome || 0)}</span>
        </div>
        <div className="summary-item">
          <span>Checking Account:</span>
          <span>{formatCurrency(gameState.currentBalance || 0)}</span>
        </div>
      </div>

      <div className="main-content">
        {showNameInput && (
          <form onSubmit={handleNameSubmit}>
            <h2>Welcome to Your Financial Journey</h2>
            <input 
              type="text" 
              name="playerName" 
              placeholder="Enter your name"
              required 
            />
            <button type="submit">Continue</button>
          </form>
        )}

        {!showW4Form && !showResults && !showNameInput && (
          <div className="job-selection">
            <h2>Select Your Job</h2>
            <button onClick={() => handleJobSelection(3000)}>Entry Level ($3,000)</button>
            <button onClick={() => handleJobSelection(4000)}>Mid Level ($4,000)</button>
            <button onClick={() => handleJobSelection(5000)}>Senior Level ($5,000)</button>
          </div>
        )}

        {showW4Form && (
          <form onSubmit={calculateNetPay} className="w4-form">
            <h2>W-4 Form</h2>
            <div className="allowance-inputs">
              <label>
                Allowance 1:
                <input type="number" name="allowance1" min="0" max="4" />
              </label>
              <label>
                Allowance 2:
                <input type="number" name="allowance2" min="0" max="4" />
              </label>
              <label>
                Allowance 3:
                <input type="number" name="allowance3" min="0" max="4" />
              </label>
            </div>
            <button type="submit">Calculate Net Pay</button>
          </form>
        )}

        {showResults && (
          <div className="results-section">
            <h2>Your Financial Summary</h2>
            <div className="result-item">
              <span>Gross Income:</span>
              <span>{formatCurrency(gameState.grossIncome)}</span>
            </div>
            <div className="result-item">
              <span>Social Security:</span>
              <span>{formatCurrency(gameState.grossIncome * 0.038)}</span>
            </div>
            <div className="result-item">
              <span>Income Tax:</span>
              <span>{formatCurrency(gameState.incomeTax)}</span>
            </div>
            <div className="result-item">
              <span>Net Income:</span>
              <span>{formatCurrency(gameState.netIncome)}</span>
            </div>
            <button onClick={() => navigate('/february')}>Continue to February</button>
          </div>
        )}
      </div>
    </div>
  );
};

export default January;
